import React from 'react'
// import './NestedMapping.css'

const Users = [
  {
    'name' : "mh akash",
    'age' : 30,
    'phones':[
      {
        'home':"0158952",
      },
      {
        'office':"0589635"
      }
    ]
  },
  {
    'name' : "Robin",
    'age' : 38,
    'phones':[
      {
        'home':"01558952",
      },
      {
        'office':"05896635"
      }
    ]
  }
];
function NestedMapping() {
  return (
    <div className='container'>
       {Users.map((user)=><article>
          <p>Name: {user.name} </p>
          <p>age: {user.age} </p>
          {user.phones.map((phone)=> <div>
            <p>home:{phone.home}</p>
            <p>office:{phone.office}</p>
          </div>)}
       </article> 
       )}    
     
    </div>
  )
}

export default NestedMapping
